<style>
body{min-width:1350px!important;}
a{color:#ff00ff;}
 button:hover{background-color:#ff00ff;color:#fff;}
.apu-mobile {
  position: relative;
  width: 360px;
  height: 640px;
  margin: auto;
  border: 16px black solid;
  border-top-width: 70px;
  border-bottom-width: 60px;
  border-radius: 36px;
}
.apu-mobile:before {
  content: '';
  display: block;
  width: 60px;
  height: 7px;
  position: absolute;
  top: -34px;
  left: 50%;
  transform: translate(-50%, -50%);
  background-color: gold;
  border-radius: 10px;
}
  
  
.apu-mobile:after {
  content: '';
  display: block;
  width: 35px;
  height: 35px;
  position: absolute;
  left: 50%;
  bottom: -65px;
  transform: translate(-50%, -50%);
  background-color: #ff0000;
  border-radius: 50%;
}
.apu-mobile iframe {
  width: 360px;
  height: 100%;
  border:none!important;
}
.apu-mobile>p{
text-align:center;
color:#ff0000;
margin-top:-29px!important;
font-size:11px;
}
  
.slider {
  -webkit-appearance: none;
  width: 46%;
  height:20px;
  border-radius: 5px;
  background: #ff00ff;
  outline: none;
  opacity: 0.7;
  -webkit-transition: .2s;
  transition: opacity .2s;
  margin-right:16px;
}

.slider:hover {
  opacity: 1;
}

.slider::-webkit-slider-thumb {
  -webkit-appearance: none;
  appearance: none;
  width: 60px;
  height: 60px;
  background-size:60px 60px;

  cursor: pointer;
}
